(window.webpackJsonp=window.webpackJsonp||[]).push([[7],{791:function(n,a,t){"use strict";t.r(a),t.d(a,"default",function(){return x});var s=t(33),e=t.n(s),i=t(34),o=t.n(i),l=t(35),c=t.n(l),p=t(36),r=t.n(p),h=t(45),u=t.n(h),d=t(37),f=t.n(d),g=t(38),k=t.n(g),m=t(773),y=t.n(m),z=t(0),v=t.n(z),j=t(195);function b(n){return v.a.createElement(n.tag,y()({},n.attributes,{dangerouslySetInnerHTML:{__html:n.html}}))}function w(n){return v.a.createElement(b,{tag:"section",html:n.html,attributes:{className:"zandoc-react-markdown"}})}function S(n){return v.a.createElement(b,{tag:"style",html:n.style})}z.Component;var x=function(n){function a(){return e()(this,a),c()(this,r()(a).apply(this,arguments))}return f()(a,n),o()(a,[{key:"componentDidMount",value:function(){var n=location.hash;if(n){var a=document.querySelector('a[href="'.concat(n,'"]'));a&&Object(j.a)(document.documentElement,0,function n(a,t){for(;a;)return a.offsetTop&&"static"!==getComputedStyle(a).position&&(t+=a.offsetTop),n(a.parentNode,t);return t}(a,-9))}}},{key:"render",value:function(){return v.a.createElement("div",{className:"zandoc-react-container",key:null},v.a.createElement(S,{style:'img[alt="zent-components"] {\n  width: 492px;\n  height: 438px;\n}'}),v.a.createElement(w,{html:'<h1 class="anchor-heading"><a href="#zent">¶</a><a href="javascript:void(0)" id="zent" class="anchor-point"></a>Zent</h1>\n<p>Zent ( \\ˈzent\\ ) 是有赞 PC 端 WebUI 规范的 React 实现，提供了一整套基础的 UI 组件以及一些常用的业务组件。</p>\n<p>目前我们有 50+ 组件，这些组件都已经在有赞的各类 PC 业务中使用，我们会在此基础上，持续开发一些新组件。</p>\n<p>我们的目标是让 React 项目开发更快、更简单。</p>\n<h3 class="anchor-heading"><a href="#zu-jian-zhan-shi">¶</a><a href="javascript:void(0)" id="zu-jian-zhan-shi" class="anchor-point"></a>组件展示</h3>\n<p><img src="https://b.yzcdn.cn/public_files/2018/04/17/00778671b9657602387902b6de9d1693.png" alt="zent-components"></p>\n<h3 class="anchor-heading"><a href="#te-xing">¶</a><a href="javascript:void(0)" id="te-xing" class="anchor-point"></a>特性</h3>\n<ul>\n<li>高质量的 React 基础组件以及丰富的业务组件</li>\n<li>内置 TypeScript 类型定义文件</li>\n<li>支持定制主题</li>\n<li>代码/样式按需加载</li>\n<li>一套有赞设计师绘制的图标库</li>\n</ul>\n<h3 class="anchor-heading"><a href="#zhi-chi-huan-jing">¶</a><a href="javascript:void(0)" id="zhi-chi-huan-jing" class="anchor-point"></a>支持环境</h3>\n<ul>\n<li>React >= 16.8</li>\n<li>支持服务端渲染(SSR)</li>\n</ul>\n<h3 class="anchor-heading"><a href="#liu-lan-qi">¶</a><a href="javascript:void(0)" id="liu-lan-qi" class="anchor-point"></a>浏览器</h3>\n<h4 class="anchor-heading"><a href="#zhi-chi-de-liu-lan-qi">¶</a><a href="javascript:void(0)" id="zhi-chi-de-liu-lan-qi" class="anchor-point"></a>支持的浏览器</h4>\n<ul>\n<li>Firefox >= 52(ESR)</li>\n<li>Chrome >= 49</li>\n<li>Safari >= 9.1</li>\n<li>不支持IE</li>\n</ul>\n<h4 class="anchor-heading"><a href="#xu-yao-de-polyfill">¶</a><a href="javascript:void(0)" id="xu-yao-de-polyfill" class="anchor-point"></a>需要的polyfill</h4>\n<p>对于受支持的浏览器需要的polyfill</p>\n<ul>\n<li>String.prototype.padStart (Chrome 57, Safari 10)</li>\n</ul>\n<h4 class="anchor-heading"><a href="#qi-ta-liu-lan-qi">¶</a><a href="javascript:void(0)" id="qi-ta-liu-lan-qi" class="anchor-point"></a>其他浏览器</h4>\n<p>关于样式请参考<a href="theme">定制主题</a></p>\n<p>可能需要的polyfill：</p>\n<ul>\n<li>Map</li>\n<li>Set</li>\n<li>Array.prototype.includes</li>\n<li>String.prototype.includes</li>\n<li>Object.assign</li>\n<li>Object.is</li>\n</ul>\n<h3 class="anchor-heading"><a href="#an-zhuang">¶</a><a href="javascript:void(0)" id="an-zhuang" class="anchor-point"></a>安装</h3>\n<pre><code class="language-bash">yarn add zent</code></pre>\n<h3 class="anchor-heading"><a href="#shi-yong-zu-jian">¶</a><a href="javascript:void(0)" id="shi-yong-zu-jian" class="anchor-point"></a>使用组件</h3>\n<pre><code class="language-jsx"><span class="token keyword">import</span> <span class="token punctuation">{</span> Button <span class="token punctuation">}</span> <span class="token keyword">from</span> <span class="token string">\'zent\'</span><span class="token punctuation">;</span>\n\n<span class="token comment">// 引入样式</span>\n<span class="token keyword">import</span> <span class="token string">\'zent/css/index.css\'</span><span class="token punctuation">;</span>\n\nReactDOM<span class="token punctuation">.</span><span class="token function">render</span><span class="token punctuation">(</span><span class="token tag"><span class="token tag"><span class="token punctuation">&#x3C;</span>Button</span> <span class="token punctuation">/></span></span><span class="token punctuation">,</span> mountNode<span class="token punctuation">)</span><span class="token punctuation">;</span></code></pre>\n<h3 class="anchor-heading"><a href="#an-xu-jia-zai">¶</a><a href="javascript:void(0)" id="an-xu-jia-zai" class="anchor-point"></a>按需加载</h3>\n<p><a href="babel-plugin-zent">babel-plugin-zent</a> 这个 babel 插件可以帮助减小打包文件的大小，原理是自动做了类似下面的代码变换。</p>\n<pre><code class="language-js"><span class="token keyword">import</span> <span class="token punctuation">{</span> Button <span class="token punctuation">}</span> <span class="token keyword">from</span> <span class="token string">\'zent\'</span><span class="token punctuation">;</span>\n\n<span class="token comment">// 变换为</span>\n\n<span class="token keyword">import</span> Button <span class="token keyword">from</span> <span class="token string">\'zent/lib/button\'</span><span class="token punctuation">;</span></code></pre>\n<p>适用于基于 Zent 开发的组件库，以及对 Zent 使用量较少的项目。详细使用帮助请看<a href="babel-plugin-zent">插件的文档</a>。</p>\n<p>除此之外，Zent 也支持 ESM 的 tree-shaking 方式配合打包工具来实现按需加载。</p>'}))}}]),a}(z.Component)}}]);